import Link from "next/link"
import Layout from "../components/layout"

export default function Page404() {
  return (
    <Layout title="404">
      <h4>Страница не найдена!</h4>
      <p>Вернуться на <Link href="/"><a>главную</a></Link> страницу</p>
    </Layout>
  )
}
